"use strict";(self.webpackChunkdocs_fintesk_com=self.webpackChunkdocs_fintesk_com||[]).push([[6769],{70542:e=>{e.exports=JSON.parse('{"tag":{"label":"Troubleshooting","permalink":"/es/tags/troubleshooting","allTagsPath":"/es/tags","count":6,"items":[{"id":"kb/troubleshooting/can-fintesk-be-used-offline","title":"Can Fintesk be used offline?","description":"Fintesk doesn\'t have a separate desktop app and can only be used online within a web browser.","permalink":"/es/kb/troubleshooting/can-fintesk-be-used-offline"},{"id":"kb/troubleshooting/how-can-i-take-a-screenshot","title":"How can I take a screenshot?","description":"Note: When taking a screenshot, please be sure to include as much detail as possible, particularly making sure the URL is visible at the top of the screen, the user logged in is visible in the top right corner of the screen and if any filters are applied the filter menu is visible on applicable pages (on the pipeline or list views, for example).","permalink":"/es/kb/troubleshooting/how-can-i-take-a-screenshot"},{"id":"kb/troubleshooting/how-do-i-clear-my-browser-s-cache-and-cookies","title":"How do I clear my browser\'s cache and cookies?","description":"If you are seeing general performance issues in your Fintesk account, it may be a good idea to clear your browser\u2019s cache and cookies as the first troubleshooting step.","permalink":"/es/kb/troubleshooting/how-do-i-clear-my-browser-s-cache-and-cookies"},{"id":"kb/troubleshooting/how-do-i-open-my-browser-console","title":"How do I open my browser console?","description":"Note: In order for our team to troubleshoot effectively, please make sure the screenshot is of the full page and that all error messages are displayed.","permalink":"/es/kb/troubleshooting/how-do-i-open-my-browser-console"},{"id":"kb/troubleshooting/troubleshooting-fintesk-web-app","title":"Troubleshooting-> Fintesk web app","description":"When using the Fintesk web app, you may run into some performance issues that may prevent you from having a seamless sales process. We\u2019ve provided a few troubleshooting tips in this article that you can test out if you run into any technical issues while using Fintesk.","permalink":"/es/kb/troubleshooting/troubleshooting-fintesk-web-app"},{"id":"kb/troubleshooting/which-browser-is-best-for-fintesk","title":"Which browser is best for Fintesk?","description":"Google Chrome and Edge will provide the best experiences when using Fintesk. We recommend staying away from common default browsers, such as Internet Explorer and Safari, as they may cause performance issues.","permalink":"/es/kb/troubleshooting/which-browser-is-best-for-fintesk"}],"unlisted":false}}')}}]);